Der Fehler, den du siehst, deutet darauf hin, dass irgendwo in deinem Code versucht wird, einen `String` in einen `int` zu konvertieren, was nicht möglich ist. Der Fehler tritt in der Datei `IoWikiByFile.java` auf, Zeile 36, Spalte 53.

Da du die Funktion `getIoWikiMap` und die Importe bereitgestellt hast, aber nicht den gesamten Code der Datei `IoWikiByFile.java`, kann ich nur vermuten, wo der Fehler liegt. Es scheint jedoch, dass der Fehler nicht direkt in der `getIoWikiMap`-Methode liegt, sondern möglicherweise in einer anderen Methode oder in der Art und Weise, wie `ioWikiRepository.findAll()` verwendet wird.

Hier sind einige Schritte, die du unternehmen kannst, um den Fehler zu beheben:

1. Überprüfe die Datei `IoWikiByFile.java` in der angegebenen Zeile und Spalte. Suche nach einer Stelle, an der ein `String` in einen `int` konvertiert werden soll.

2. Stelle sicher, dass alle Methodenaufrufe und Zuweisungen die richtigen Datentypen verwenden.

3. Überprüfe die Definition von `ioWikiRepository.findAll()`, um sicherzustellen, dass sie den richtigen Rückgabewert hat.

