Falls der Fehler weiterhin besteht, überprüfe die Zeile 36 in `IoWikiByFile.java` und stelle sicher, dass dort keine fehlerhafte Typkonvertierung stattfindet. Wenn du den relevanten Codeabschnitt aus dieser Datei bereitstellen kannst, kann ich dir gezielter helfen.
